import TextField from '@material-ui/core/TextField';
import { Button } from '@material-ui/core'
import {toast} from 'react-toastify'
const algosdk = require('algosdk');
const crypto = require('crypto');


const algodAddress = "https://testnet.algoexplorerapi.io/";
const algodToken = "";
const algodPort ="";

let algodClient = new algosdk.Algodv2(algodToken, algodAddress, algodPort);

const indexer_token = "";
const indexer_server = "https://testnet.algoexplorerapi.io/idx2/";
const indexer_port = 0;

let indexerClient = new algosdk.Indexer(indexer_token, indexer_server, indexer_port);

var check =algodClient.healthCheck().do();
if (check){
    console.log("client connected")
}
var idxCheck = indexerClient.healthCheck().do();
if (idxCheck){
    console.log("idx connected")
}
const useStyles = makeStyles((theme) => ({
    margin: {
        margin: theme.spacing(1),
    },
}));

function hashPassPhrase(passPhrase) {
    const hash = crypto.createHash('sha256')
    hash.update(passPhrase)
    return hash.digest('hex')
}

if (typeof AlgoSigner !== 'undefined') {
    document.getElementById('check-code').innerHTML = 'AlgoSigner is installed.';
  } else {
    document.getElementById('check-code').innerHTML = 'AlgoSigner is NOT installed.';
  }




