    const [carColor, setCarColor] = React.useState('')
    const [carOwner, setCarOwner] = React.useState('')
    const [passPhrase, setPassPhrase] = React.useState('')

    //Handlers
    const handleCarID = (event) => {
        setCarID(event.target.value)
    }

    const handleCarModel = (event) => {
        setCarModel(event.target.value)
    }

    const handleCarMake = (event) => {
        setCarMake(event.target.value)
    }

    const handleCarColor = (event) => {
        setCarColor(event.target.value)
    }

    const handleCarOwner = (event) => {
        setCarOwner(event.target.value)
    }

    const handlePassPhrase = (event) => {
        setPassPhrase(event.target.value)
    }

    const handleSubmit = async () => {
        try{

        }catch(err){
            toast.error('Error!!! Failed to add Car', err)
        }
    }

    const allData = () => {
        return {
            'carID': carID,
            'carColor': carColor,
            'carModel': carModel,
            'carOwner': carOwner,
            'carMake': carMake,
            'passPhrase': passPhrase,
        }
    }

    return (
        <div>
            <TextField
                className={classes.margin}
                id="input-with-icon-textfield"
                label="CarID"
                InputProps={{
                    startAdornment: (
                        <InputAdornment position="start">
                        </InputAdornment>
                    ),
                }}
                onInput={handleCarID}
            />
            <TextField
                className={classes.margin}
                id="input-with-icon-textfield"
                label="Car Make"
                InputProps={{
                    startAdornment: (
                        <InputAdornment position="start">
                        </InputAdornment>
                    ),
                }}
                onInput={handleCarMake}
            />
            <TextField
                className={classes.margin}
                id="input-with-icon-textfield"
                label="Car Model"
                InputProps={{
                    startAdornment: (
                        <InputAdornment position="start">
                        </InputAdornment>
                    ),
                }}
                onInput={handleCarModel}
            />
            <TextField
                className={classes.margin}
                id="input-with-icon-textfield"
                label="Car Color"
                InputProps={{
                    startAdornment: (
                        <InputAdornment position="start">
                        </InputAdornment>
                    ),
                }}
                onInput={handleCarColor}
            />
            <TextField
                className={classes.margin}
                id="input-with-icon-textfield"
                label="Car Owner"
                InputProps={{
                    startAdornment: (
                        <InputAdornment position="start">
                        </InputAdornment>
                    ),
                }}
                onInput={handleCarOwner}
            />
            {/* <TextField
                className={classes.margin}
                id="input-with-icon-textfield"
                label="Secret Pass Phrase"
                InputProps={{
                    startAdornment: (
                        <InputAdornment position="start">
                        </InputAdornment>
                    ),
                }}
                onInput={handlePassPhrase}
            /> */}
            <Button onClick={handleSubmit}>
                Submit
            </Button>
        </div>
    );
}
